    public static function render($iconName)
    {
        if (!is_array($iconName) && is_string($iconName) && array_key_exists($iconName, static::ICONS)) {
            foreach (self::ICONS as $key => $value) {
                if ($iconName == $key) {
                    return $value;
                }
            }
        }

        return 'default';
    }
